import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
  return (
    <Card
			action={[
				<div key="twit">잭잭<br/></div>,
				<div key="follings">잭잭<br/></div>,
				<div key="twit">잭잭<br/></div>
			]}
		>
      <Card.Meta avatar={<Avatar>HJY</Avatar>} title="종윤" />
    </Card>
  );
};

export default UserProfile;
